    VALUES ('Broek Op Langedijk', '/clubs/broek-op-langedijk/')
    RETURNING id
)
INSERT INTO clubs (city_id, name, endpoint, image_url)
SELECT inserted_city.id, club_data.name, club_data.endpoint, club_data.image_url
FROM inserted_city, (
    SELECT 'CSV BOL' AS name, '/clubs/b/bol/' AS endpoint, 'https://www.hollandsevelden.nl/images/club_logo_van_voetbalvereniging_bol_uit_broek-op-langedijk.png' AS image_url
) AS club_data(name, endpoint, image_url);

