    VALUES ('Schalkhaar', '/clubs/schalkhaar/')
    RETURNING id
)
INSERT INTO clubs (city_id, name, endpoint, image_url)
SELECT inserted_city.id, club_data.name, club_data.endpoint, club_data.image_url
FROM inserted_city, (
    SELECT 'SV Schalkhaar' AS name, '/clubs/s/schalkhaar/' AS endpoint, 'https://www.hollandsevelden.nl/images/club_logo_van_voetbalvereniging_schalkhaar_uit_schalkhaar.png' AS image_url
) AS club_data(name, endpoint, image_url);

